import { Box, Button, Text } from "@chakra-ui/react";


function Home(){

    return (
        <div>
            <Text>
            >(6xl) In love with React & Next
            </Text>
            <Box>
            <Button colorScheme='blue'>Button</Button>
            </Box>
        </div>
    )
}

export default Home;
